import './Chat.css'
import BotonFormulario from '../botones/BotonFormulario';

const Chat = () => {
    return (
            <div className="modulo-chat">
                <div>
                    <span>Imagen</span>
                </div>
                <div>
                    <span>Nombre</span>
                </div>
                <div>
                    <span>Comunicación Asíncrona</span>
                </div>
                <div>
                    <BotonFormulario className="boton-aceptar" name="boton" value="Siguiente"/>
                </div>
            </div>
    );

}

export default Chat;
